  render() {

    return (
      <Fragment>
        <h1>Hello</h1>
        <p>
          Go to{" "}
          <Link href="/about">
            <a>Auth</a>
          </Link>
        </p>
        <button onClick={() => Router.push("/about")}>Go to Auth</button>
      </Fragment>

    )
  }
}

export default Index
